/* eslint-disable */

declare module "*.svg" {
  const content: any;
  export default content;
}

declare module "*.ttf" {
  const content: string;
  export default content;
}

declare module "*.json" {
  const value: any;
  export default value;
}

declare module "*.jpg" {
  const content: string;
  export default content;
}

declare module "*.png" {
  const content: string;
  export default content;
}
